import React from "react";
import { NavLink } from "react-router-dom";
import "./SideBar.css";

const SideBar = () => {
  return (
    <div className="SideBar">
      <NavLink to={{ pathname: `/home` }} activeClassName="active">
        Home
      </NavLink>
    </div>
  );
};

export default SideBar;
